import React from "react";
import AddButton from "./AddButton";

function AddBar(props){
    return <div>
    <span>
    <form>
        <input
        onChange={props.makeItem}
        name="item"
        placeholder="Items to add..."
        /> 
         <AddButton />
    </form>

    </span>
</div>     
}

export default AddBar;
